import React, { Component } from 'react';

import { DefaultPalette, Stack, IStackStyles, IStackTokens } from 'office-ui-fabric-react';

const stackStyles: IStackStyles = {
    root: {
      background: DefaultPalette.themeTertiary,
    },
  };

  const horizontalGapStackTokens: IStackTokens = {
    childrenGap: 10,
    padding: 10,
  };

class Navbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav>
                <Stack horizontal styles={stackStyles} tokens={horizontalGapStackTokens}>
                    <Stack.Item>Home</Stack.Item>
                    <Stack.Item>People</Stack.Item>
                    <Stack.Item>About</Stack.Item>
                    <Stack.Item>Blog</Stack.Item>
                </Stack>
            </nav>
        )
    }
}

export default Navbar;
